import React from 'react'

function GitHubUser() {
    return (
        <>
            <div style={{backgroundColor:'lightgray',width:'100vh'}} >
                <div style={{ width: '80%', margin: 'auto' }}>
                    <h2 style={{ textAlign: 'center', padding: '8px' }}>List of Git Hub Users</h2>
                </div>
            </div>
        </>
    )
}
export default GitHubUser;
